import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Table from 'react-bootstrap/Table';
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';
import Modal from 'react-bootstrap/Modal';
import 'bootstrap/dist/css/bootstrap.css';
import './styles/styles.css';
import num1 from './audio/1.mp3'
import num2 from './audio/2.mp3'
import num3 from './audio/3.mp3'
import num4 from './audio/4.mp3'
import num5 from './audio/5.mp3'
import num6 from './audio/6.mp3'
import num7 from './audio/7.mp3'
import num8 from './audio/8.mp3'
import num9 from './audio/9.mp3'
import num10 from './audio/10.mp3'

import { useState, useEffect } from 'react';

function App() {
  const [trialCount, setTrialCount] = useState(() => {
    return JSON.parse(window.localStorage.getItem('COUNT')) || 1
  });

  const list_audio_source = [num1, num2, num3, num4, num5, num6, num7, num8, num9, num10];
  const list_audio = [];
  for (let i=0; i<list_audio_source.length; i++) {
    let audioFile = new Audio(list_audio_source[i]);
    list_audio.push(audioFile)
  }

  function handlePlay() {
    list_audio[0].play()
  }

  return (
    <>
      <Navbar bg="primary" data-bs-theme="dark">
        <Container>
          <Navbar.Brand href="#home">Digit Monitoring Task</Navbar.Brand>
          <Nav>
            <Nav.Link href="https://uwaterloo.ca/neurocognition-mobility-lab">Neuro-cognition & Mobility Lab</Nav.Link>
          </Nav>
        </Container>
      </Navbar>

      <Card style={{ width: '20vw', boxShadow: "1px 4px 4px #e1e1e1", marginLeft: '40vw' }}>
          <Button variant="outline-dark" size="block" onClick={handlePlay}>Play Sound</Button>
      </Card>
    </>
  );
}

export default App;
